Instruction.String:
// create PubSubMsg
newEvent = Publisher.BackOfficeAgent.MonSys.Create("PubMsg") as PubMsg;

// set situation id
// set isAlert
// set topic
TopicRef tRef = Publisher.BackOfficeAgent.MonSys.Create("TopicRef") as TopicRef;
tRef.Topic = Publisher.regTopic;	
newEvent.TopicRefLink = tRef;

Publisher.BackOfficeAgent.PubCount++;

double rand = Random.Uniform();
if (rand <= Publisher.CreateP)
	Choice = 1;
else 
	Choice = 0;

while (EventCoord.InQueue.Count > 0)
{
	PubMsg msg = EventCoord.InQueue.Dequeue();
	Topic topic = msg.TopicRef;
	foreach (MonSysContext.BackOfficeAgentContext.Subscriber sub in topic.Subscribers)
	{
		NfyMsg exMsg;		
		if (EventCoord.EventDict.TryGetValue(sub, out exMsg))
		{
			exMsg.MsgList.Add(msg);
			//EventCoord.EventDict[sub] = exMsg;
		}
		else
		{
			exMsg = EventCoord.PubSubMW.MonSys.Create("NfyMsg") as NfyMsg;
			exMsg.MsgList.Add(msg);
			exMsg.Receiver = sub;
			EventCoord.EventDict.Add(sub,exMsg);
		}				
	}
}

foreach (KeyValuePair<MonSysContext.BackOfficeAgentContext.Subscriber,NfyMsg> pair in EventCoord.EventDict)
{
	NfyMsg msg = pair.Value;
	msg.Created();	    
}
EventCoord.EventDict.Clear();

EventCoord.isIdle = true;
